import React, {useEffect} from 'react';
import './trackerOrientation.scss';
// import {rotateOnce} from '../../../../../anime/rotations';
import anime from 'animejs';
import {textWipeIn} from '../../../../../anime/svgTexts';
// import {pathDraw} from '../../../../../anime/svgPaths';

const rotateToLandscape = (animatedClass) => {
    anime({
        targets: animatedClass,
        translateX: [-230, 0],
        translateY: [-40, 0],
        rotate: [-90, 0],
        duration: 1000,
        delay: 500,
        endDelay: 1500,
        direction: 'alternate',
        loop: true
    });
}

const arrowDraw = (animatedClass) => {
    anime({
        targets: animatedClass,
        strokeDashoffset: [anime.setDashoffset, 0],
        easing: 'easeInOutSine',
        duration: 1000,
        delay: 500,
        endDelay: 1500,
        direction: 'alternate',
        loop: true
    });
}

const phonesMoveLeft = (animatedClass) => {
    anime({
        targets: animatedClass,
        translateX: [180, 0],
        duration: 1000,
        delay: 500,
        endDelay: 1500,
        direction: 'alternate',
        loop: true
    });
}



